(1, 'Dmitri', 432, 'Male', 'Russian', 'Protagonist', 'Dimitri was born in 991 in  Kievan Rus\' in a relatively larger village for the era. The circumstances in which he was born were not fortunate for him nor the citizens of the town. The context of his birth was during an extreme Russian winter, seasons long ice age that limited the amount of humans Count Orlock, the Nosferatu of (the town) could feed on. In face of this, Orlock took matters into his own hands and took broodmares from the town to reproduce with to both sate his desires and his hunger. One survived longer than the others, she had been turned and controlled as a slave to produce more for Orlock. Dimitri was the first child to come out of a seven total from his mother.', 'Newcomer Arc, Initiation Arc, Vasile Arc, Hallucination Arc, Investigation Arc, The Latter Days', );
INSERT INTO `unholy_characters` (`id`, `name`, `age`, `gender`, `nationality`, `role`, `backstory`, `arcs`, `image`) VALUES
(2, 'Lucian', 116, 'Male', 'Spanish', 'Antagonist', 'Lucian was the product of a vampire spawn and a human woman. His mother raised him in the Catholic Church, as she was claimed to be a holy woman. Lucian’s vampiric genes are unknown and well hidden. Growing up, Lucian took no interest in controlling his blood thirst or his abilities to take advantage of the church and its influence himself. As a child, he was taken advantage of by his priest, and from then, he realized the morality of the church and its leadership was utter nonsense- however with this, he also realized the great influence, money, and favor it won from the civilians. It was the day he decided he would climb the ranks as a holy man and become one of the most influential and trusted individuals in the church. Because of his human features, his eternal youth had been attributed to his holy blood instead, making him a well valued possession of the church as well. He would become the God they think they believe in.', 'Newcomer Arc, Initiation Arc, Vasile Arc, Hallucination Arc, The Latter Days', );
INSERT INTO `unholy_characters` (`id`, `name`, `age`, `gender`, `nationality`, `role`, `backstory`, `arcs`, `image`) VALUES
